import { useContext } from "react";
import { AuthContext } from "../../context/authContext";
import "./stories.scss";

//temp dummy data
const Stories = () => {
  const { currentUser } = useContext(AuthContext);
  const stories = [
    {
      id: 1,
      name: "User name",
      img: "https://images.pexels.com/photos/3228733/pexels-photo-3228733.jpeg?auto=compress&cs=tinysrgb&w=1600",
    },
    {
      id: 2,
      name: "User name",
      img: "https://images.pexels.com/photos/3228732/pexels-photo-3228732.jpeg?auto=compress&cs=tinysrgb&w=1600",
    },
    {
      id: 3,
      name: "User name",
      img: "https://images.pexels.com/photos/3228732/pexels-photo-3228732.jpeg?auto=compress&cs=tinysrgb&w=1600",
    },
    {
      id: 4,
      name: "User name",
      img: "https://images.pexels.com/photos/3228732/pexels-photo-3228732.jpeg?auto=compress&cs=tinysrgb&w=1600",
    },
  ];
  return (
    <div className="stories">
      <div className="story">
        <img src={currentUser.profilePic} alt="" />
        <span>{currentUser.name}</span>
      </div>
      {stories.map((story) => (
        <div className="story">
          <img src={story.img} alt="" />
          <span>{story.name}</span>
        </div>
      ))}
    </div>
  );
};

export default Stories;
